// src/components/Hero.js
import React, { useEffect } from 'react';
import './styles/Hero.css';
import watermark from '../assets/watermark.png';

function Hero() {
    useEffect(() => {
        const letters = document.querySelectorAll('.hero-title span');
        letters.forEach((letter, index) => {
            setTimeout(() => {
                letter.classList.add('show');
            }, index * 100); // Adjust timing as needed
        });
    }, []);

    return (
        <div className="hero">
            <div className="hero-background">
                <img src={watermark} alt="Watermark" className="watermark" />
            </div>
            <h1 className="hero-title">
                <span>S</span><span>v</span><span>a</span><span>s</span><span>t</span><span>h</span><span>y</span><span>a</span>
            </h1>
        </div>
    );
}

export default Hero;
